/*

10 butonun XY koordinatlar?

*/
uint16_t dokunmatik_konumlari[10][4]; // [buton numaras?][koordinat ve i?levleri X0,Y0,X1,Y1]
uint8_t dokunmatik_islevleri[10]; // i?lev numaralar?

void dokunmatik_islem_tanimi(uint8_t indis, uint8_t islev, uint16_t x, uint16_t y, uint16_t w, uint16_t h){
 dokunmatik_konumlari[indis][0] = x;
 dokunmatik_konumlari[indis][1] = y;
 dokunmatik_konumlari[indis][2] = x+w;
 dokunmatik_konumlari[indis][3] = y+h;
 dokunmatik_islevleri[indis] = islev;
}

void dokunmatik_islem_tanimi_temizle() {
 uint8_t i_;
 for (i_ = 0;i_<10;i_++) dokunmatik_islem_tanimi(i_,0,0,0,0,0);
}

void dokunmatik_calisma() {
 uint8_t i_;
 uint16_t d_x=0,d_y=0;
 for (i_ = 0;i_<10;i_++) {
  if (dokunmatik_konumlari[i_][0] < d_x && d_x < dokunmatik_konumlari[i_][2] && dokunmatik_konumlari[i_][1] < d_y && d_y < dokunmatik_konumlari[i_][3]) {
   BuzzerOn();delay_ms1(100);BuzzerOff();
   ana_islemler(dokunmatik_islevleri[i_]);
  }
 }
}

