void Ekran_Doldur_XY(uint16_t x, uint16_t y, uint8_t w, uint8_t h, uint16_t renk) {
 uint16_t _xo,_yo;
 for (_xo=x;_xo<(x+w);_xo++) {
  for (_yo=y;_yo<(y+h);_yo++) {
   pixel_yaz(_xo, _yo, renk);
  }
 }
}

void Ekran_Resim_bas(uint8_t* Resim) {
 int _xo, _yo;
 for (_xo=0;_xo<320;_xo++) {
  for (_yo=0;_yo<240;_yo++) {
   int konum = 2*(_xo + _yo*320);
   uint16_t renk = (uint8_t) Resim[konum+1];
   renk += ((uint8_t) Resim[konum])*256;
   pixel_yaz(_xo, _yo, renk);
  }
 }
}

void Pixel_yaz_KIG(uint16_t x, uint16_t y, uint16_t renk) {
 int _xo, _yo, kalinlik=2;
 for(_xo=0;_xo<kalinlik;_xo++) for(_yo=0;_yo<kalinlik;_yo++) pixel_yaz(x+_xo, y+_yo, renk);
}

void Kutu_ciz(uint16_t x, uint16_t y, uint8_t w, uint8_t h, uint16_t renk) {
 uint8_t i_;
 for (i_=y;i_<(y+h);i_++) pixel_yaz(x, i_, renk); // sol kenar
 for (i_=y;i_<(y+h);i_++) pixel_yaz(x+w, i_, renk); // sag kenar
 for (i_=x;i_<(x+w);i_++) pixel_yaz(i_, y, renk); // ust kenar
 for (i_=x;i_<(x+w);i_++) pixel_yaz(i_, y+h, renk); // alt kenar
}

void Ekran_tetikle(void) { // Ekran tetikleme-uyarma fonksiyonu
 int _xo,_yo;
 for (_yo=0;_yo<10;_yo++) for (_xo=0;_xo<320;_xo++) pixel_yaz(_xo,_yo, pixel_oku(_xo,_yo));
 for (_yo=239;_yo>230;_yo--) for (_xo=0;_xo<320;_xo++) pixel_yaz(_xo,_yo, pixel_oku(_xo,_yo));
}

