void Ekrana_Bas(const char *yazi, uint16_t x, uint16_t y, uint16_t renk) {
 unsigned char alfa;
 uint8_t grafik_;
 int _xo,_yo,_xoo = x;
 while(*yazi) {
  alfa = *yazi++;
  if (alfa == '\n') {
   x = _xoo;
   y += 12; // örnek olarak 8 * 1.5
   continue;
  } else if (alfa == '?') break;
  for(_yo=0;_yo<8;_yo++) {
   grafik_ = Harfler_8x8[alfa][_yo];
   for (_xo=0;_xo<8;_xo++) {
    if((grafik_>>_xo)%2==1) pixel_yaz(_xo+x,_yo+y,renk);
   }
  }
  x += 8;
 }
 Ekran_tetikle();
}

void Ekrana_Sayi_Bas(int sayi, uint16_t x, uint16_t y, uint16_t renk) {
 char yazi;
 int sayi_ = sayi;
 if (sayi == 0) Ekrana_Bas("0", x, y, renk);
 while (sayi_>9){
  sayi_ /= 10;
  x += 8;
 }
 while (sayi > 0) {
  uint8_t sayi_on = sayi%10;
  sayi /= 10;
  yazi = 48 + sayi_on;
  Ekrana_Bas(&yazi, x, y, renk);
  x -= 8;
 }
}

