void i2cyaz(uint8_t dat3) {
 //uint8_t dat[3]={0xA0,0xf8,0};      
 uint8_t i,j; 
 //dat[2]=dat3;
 if(dat3<0x7f) {           
  SYS_PORTS_PinClear( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_15 ); //Data
  delay_us(4);
  SYS_PORTS_PinClear( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_14 ); //clck
  delay_us(5);
  for(j=0;j<3;j++) {
   for(i=0;i<8;i++) {
    if(testbit(dat[j], 7-i))SYS_PORTS_PinSet( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_15 ); //Data
    else SYS_PORTS_PinClear( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_15 ); //Data
    delay_us(2);
    SYS_PORTS_PinSet( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_14 ); //clck
    delay_us(4);
    SYS_PORTS_PinClear( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_14 ); //clck
    delay_us(2);
   }
   SYS_PORTS_PinSet( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_15 );//Data
   delay_us(2);
   SYS_PORTS_PinSet( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_14 ); //clck
   delay_us(4);
   SYS_PORTS_PinClear( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_14 ); //clck
   delay_us(2);  
  }
  SYS_PORTS_PinClear( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_15 ); //Data
  delay_us(2);
  SYS_PORTS_PinSet( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_14 ); //clck
  delay_us(4);
  SYS_PORTS_PinSet( PORTS_ID_0, PORT_CHANNEL_A, PORTS_BIT_POS_15 );//Data
 }
}

void lnp_gain_kontrol(uint8_t gain_val) {
 switch (gain_val) {
  case lnpgain_3db : F_regs_LNP_gain_set(lnpgain_3db);break;
  case lnpgain_12db: F_regs_LNP_gain_set(lnpgain_12db);break;
  case lnpgain_18db: F_regs_LNP_gain_set(lnpgain_18db);break;
  case lnpgain_22db: F_regs_LNP_gain_set(lnpgain_22db);break;
  case lnp_pwrdwn: F_regs_LNP_gain_set(lnp_pwrdwn);break;
  case pwr_dwn_all: F_regs_LNP_gain_set(pwr_dwn_all);break;
  default: {break;}
 }
}

void vga_gain_kontrol(uint8_t gain_val) {
 if(gain_val<=128) {
  dat[0]=0xA0;
  dat[1]=0xf8;
  dat[2]=gain_val*3;
  i2cyaz(gain_val*3); //+3 0 db de?ernin yakla?t?r?yor
  dat[0]=0xA0;
  dat[1]=0xfa;
  dat[2]=gain_val*3+3;
 }
}

void HV_Set(uint8_t hv_val) {
 dat[0]=0x50;
 dat[1]=0x00;
 dat[2]=hv_val;
 i2cyaz(hv_val);
 dat[0]=0x50;
 dat[1]=0x10;
 dat[2]=hv_val;
 i2cyaz(hv_val);
}
